		int n = nums.length;
		int[] abs = new int[(n * (n - 1) / 2)];

		int num = 0;

		for (int i = 0; i < nums.length - 1; i++) {
			for (int j = i + 1; j < nums.length; j++) {
				abs[num++] = Math.abs(nums[i] - nums[j]);
			}
		}

		System.out.println(Arrays.toString(abs));
